INSERT INTO `News` VALUES ('1', '1', '1', 'BOLPEGAS S.R.L. CREA UNIDAD DE NEGOCIOS', '', 'Con el objetivo de fomentar y generar nuevas oportunidades de trabajo y diversificar sus actividades, Bolpegas ahora cuenta con una Unidad de Negocios. EstÃ¡ conformada por los ingenieros Luis Mantilla como Jefe de la Unidad, Jorge Flores como asesor y Roberto OrdoÃ±ez como profesional especialista. Todos ellos con vasta experiencia y conocimientos en el sector de hidrocarburos.', '<p class=\"MsoNormal\" style=\"margin: 3pt 0cm; line-height: 21.4286px; vertical-align: baseline; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\"><span lang=\"ES\">Con el objetivo de fomentar y generar nuevas oportunidades de trabajo y diversificar sus actividades, Bolpegas ahora cuenta con una Unidad de Negocios. EstÃ¡ conformada por los ingenieros Luis Mantilla como Jefe de la Unidad, Jorge Flores como asesor y Roberto OrdoÃ±ez como profesional especialista. Todos ellos con vasta experiencia y conocimientos en el sector de hidrocarburos.<br><br></span><span lang=\"ES\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin: 3pt 0cm; line-height: 21.4286px; vertical-align: baseline; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\"><span lang=\"ES\">Esta unidad se encargarÃ¡ de manejar las relaciones con empresas asociadas y representadas y promover actividades que permitan incrementar la cartera de servicios que Bolpegas pretende ofrecer a sus clientes.</span><span lang=\"ES\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin: 3pt 0cm; line-height: 21.4286px; vertical-align: baseline; background-image: initial; background-attachment: initial; background-size: initial; background-origin: in