limiento de las exigencias legales del Estado boliviano. Fue una auditoria exhaustiva, pero lo hemos logradoâ€, resaltÃ³ Luis Mantilla, Gerente de Calidad y SMS.Â â€œPara nosotros es un orgullo certificar desde el 2003. Empezamos con la obtenciÃ³n del certificado de calidad segÃºn la norma de calidad ISO-9001 y despuÃ©s, a partir del 2009,Â tenemos certificados para calidad, seguridad y medio ambienteâ€, finalizÃ³ Mantilla.Â <o:p></o:p></span></p><p class=\"MsoNormal\" style=\"line-height: 21.4286px;\"><span lang=\"ES\">La polÃ­tica de calidad, seguridad, medio ambiente y salud ocupacional deÂ BOLPEGAS es entregar a sus clientes obras y/o servicios con una calidad que estÃ© de acuerdo con los diseÃ±os suministrados y los requerimientos contractuales dentro de los costos y tiempos pactados y que cumplan con las normas tÃ©cnicas, requisitos legales y de otro tipo.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"line-height: 21.4286px;\"><span lang=\"ES\">Para hacer realidad esta polÃ­tica, la Gerencia de la compaÃ±Ã­a ha decidido desarrollar un Sistema Integrado de GestiÃ³n de Calidad, Seguridad, Medio Ambiente y Salud Ocupacional, siguiendo los lineamientos indicados en las normas vigentesÂ ISO-9001:2008,Â OHSAS 18001:2007Â eÂ ISO-14001:2004. Este debe ser aplicado tanto en las actividades cotidianas de la empresa como en los servicios que la misma presta a sus clientes.</span></p>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n', '2016-02-18', 'certificacin-iso-por-ms-de-una-dcada.html', 'BOLPEGAS', '0', '0', '0', '0', '5772cf3bbf290.jpg', '1', '0'), ('2', '1', '7', 'CERTIFICACIÃ“N ISO POR MÃS DE UNA DÃ‰CADA', '', 'Desde hace 12 aÃ±os todas las actividades de BOLPEGAS se desarrollan con el sello de la certificaciÃ³n TÃœV Rheinland (normas ISO-9001). Hace 6 aÃ±os integramos nuestro sistema de gestiÃ³n para certificar tambiÃ©n en las normas ISO-14001 y BS-OHSAS-18001.', '<p class=\"MsoNormal\" style=\"line