, seguridad, medio ambiente y salud ocupacional deÂ BOLPEGAS es entregar a sus clientes obras y/o servicios con una calidad que estÃ© de acuerdo con los diseÃ±os suministrados y los requerimientos contractuales dentro de los costos y tiempos pactados y que cumplan con las normas tÃ©cnicas, requisitos legales y de otro tipo.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"line-height: 21.4286px;\"><span lang=\"ES\">Para hacer realidad esta polÃ­tica, la Gerencia de la compaÃ±Ã­a ha decidido desarrollar un Sistema Integrado de GestiÃ³n de Calidad, Seguridad, Medio Ambiente y Salud Ocupacional, siguiendo los lineamientos indicados en las normas vigentesÂ ISO-9001:2008,Â OHSAS 18001:2007Â eÂ ISO-14001:2004. Este debe ser aplicado tanto en las actividades cotidianas de la empresa como en los servicios que la misma presta a sus clientes.</span></p>', '2016-02-18', 'certificacin-iso-por-ms-de-una-dcada.html', '', '0', '0', '0', '0', '5772cf3bbf290.jpg', '1', '0');
